Sociopolitical Documentary hosted by Will Lyman, published by PBS broadcasted as part of PBS Frontline series in 2011 - English narration


Information
------------------------------

Football High - Bigger and faster, but safer? 
High school football has never had a higher profile, with nationally televised games, corporate sponsorships, and minute-by-minute coverage on sports websites.In northwest Arkansas, FRONTLINE examines one ambitious high school team working its way towards national renown. 
With a superstar quarterback at the helm, tiny Shiloh Christian is striving to join the ranks of the country's best high school teams--teams whose workout schedules, practices, and styles of play increasingly imitate the pros. But as high school players grow bigger, faster, and stronger, there are growing concerns about the health and safety of these young players, with rising rates of concussions and death from heat stroke.

